import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
import React from 'react'
import News from "../home_right/news/News";
import SubUser from "../home_right/subUser/SubUser";

export default function RouterHome() {
    return (
        <div>
             <Switch>
                        <Route path="/news">
                            <News />
                        </Route>

                         <Route path="/subUser">
                            <SubUser />
                        </Route>
                </Switch>
            
        </div>
    )
}
